import React from 'react';
import Logo from "../Img/istockphoto-1301346291-612x612.jpg"
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className='navbar'>
      <div className="container">
        <div className="logo">
          <img src={Logo} alt="" />
        </div>
          <div className="links">
            <Link className='link' to="" >h ART</Link>
          </div>
      </div>
    </div>
  )
}

export default Navbar
